import { Template } from 'meteor/templating';
import { Collection2 } from 'meteor/aldeed:collection2';
import { AutoForm } from 'meteor/aldeed:autoform';

import SimpleSchema from 'simpl-schema';

import './deviceList.html';
import '../../api/page/page.js';
import '../../lib/collections.js';
import '../../api/_method.js';

Template.deviceList.onRendered(function () {
    Session.set("SearchKey", null);
    PageTools.init();
    // PageTools.setTotal(50);   

    var self=this;
    this.autorun(function () {
        // PageTools.getCollectionCount("deviceListCount", Session.get("SearchKey"));
        self.subscribe("currentDeviceList", Meteor.userId(), Session.get("SearchKey"), Session.get("TableLimitKey"), Session.get("TableSkipKey"));
    });
    Session.set("userStatus", null);
    PageTools.refresh()
});

Template.deviceList.helpers({
    /**
     * Device list 列表
     * @returns {*}
     */
    "deviceListInfo": function () {
        var search = Session.get("SearchKey");
        var select = {};
        if (search) {
        }
        return DeviceList.find(select);
    },
    "submitButtonStatus": function () {
        if (Session.get("userStatus")) {
            return false;
        } else {
            return true;
        }
    },
});

Template.deviceList.events({
    "change #limitShow": function () {
        var limitShow = $("#limitShow option:selected").val();
        PageTools.setLimit(parseInt(limitShow));
        PageTools.setSkip(0);
    },
    "click .backBtn": function (event) {
        // console.log(evnet);
    },
    "change .clientIds": function (event) {
        var username = $(event.currentTarget).val().trim();
        Meteor.call("checkClientId", username, function (err, result) {
            if (result == "ClientId is not null") {
                Session.set("userStatus", true);
            } else {
                Session.set("userStatus", false);
            }
        });
    },
    "change .imeis": function (event) {
        var imei = $(event.currentTarget).val().trim();
        Meteor.call("checkImei", imei, function (err, result) {
            if (result == "Imei is not null") {
                Session.set("userStatus", true);
            } else {
                Session.set("userStatus", false);
            }
        });
    },
    'click .submitButton': function (event) {
        console.log(1);
        // var device = {};
        // device.clientId = $(".clientId").val().trim();
        // device.location = $(".location").val().trim();
        // device.imei = $(".imei").val().trim();
        // Session.set("DeviceInfo", device);
    },
});

Schemas.deviceList = new SimpleSchema({
    "clientId": {
        type: String,
        label: "ID",
    },
    "location": {
        type: String,
        label: "位置",
    },
    "imei": {
        type: String,
        label: "IMEI",
    },
    "createAt": {
        type: Date,
        label: "createAt",
        autoValue: function () {
            if (this.isInsert) {
                return new Date();
            }
        }
    }
});
DeviceList.attachSchema(Schemas.deviceList);
AutoForm.hooks({
    "adddeviceList": {
        onSuccess: function (formType, result) {
            console.log('onSuccess', result);
            // $("#addList").modal("hide");
        },
        // formToDoc: function (doc) {
        //     return doc;
        // }
    }
});
